const AuthorItem = ({ author }) => {
	return (
		<tr>
			<td>
				{author.name}
			</td>
			<td>
				{author.url}
			</td>
			<td>
				{author.is_active}
			</td>
		</tr>
	)
}

const AuthorsList = ({ authors }) => {
	if (Object.keys(authors).length != 0) {
		return (
			<div>
				{authors.results.map((author) => <AuthorItem author={author}/> )}
			</div>
		)
	}
	return(
			<p>data none</p>
	)
}

export default AuthorsList;
